import "./ColdDrinksMenuPage.css";
import ColdDrinks from "../Cold Drinks/ColdDrinks";

function ColdDrinksMenuPage() {
    return (
      <>
        <h2>Ладни пијалоци</h2>
        <div className="cold-drinks-container">
          {ColdDrinkslist()}
        </div>
      </>
    );
  }

  let drinks = [
    {
      name: "Gazirana voda 0.25",
      price: "60.00",
    },
    {
      name: "Gazirana voda 0.75",
      price: "110.00",
    },
    {
      name: "Negazirana voda 0.25",
      price: "60.00",
    },
    {
      name: "Negazirana voda 0.75",
      price: "110.00",
    },
    {
      name: "Ceden Portokal",
      price: "140.00",
    },
    {
      name: "Limonada",
      price: "130.00",
    },
  ]
  function ColdDrinkslist() {
    let lists = [];

    for (let i = 0; i < drinks.length; i++) {
      let list = (
        <ColdDrinks drink={drinks[i]} />
      );
      lists.push(list);
    }

    return lists;
  }

  export default ColdDrinksMenuPage;
